import React from 'react';
import Head from 'next/head';
import {
  AppLayout,
  ConnectionList,
  ConnectionProps,
  NicknameEditform,
} from '../components';

const Profile = () => {
  const followings: ConnectionProps[] = [
    { nickname: 'John' },
    { nickname: 'James' },
    { nickname: 'doe' },
  ];

  const followers: ConnectionProps[] = [
    { nickname: 'John follower' },
    { nickname: 'James follower' },
    { nickname: 'doe follower' },
  ];
  return (
    <div>
      <Head>
        <title>Profile | Next Tweet</title>
      </Head>
      <AppLayout>
        <NicknameEditform />
        <ConnectionList
          title='Following'
          data={followings}
        />
        <ConnectionList
          title='Follower'
          data={followers}
        />
      </AppLayout>
    </div>
  );
};

export default Profile;
